import PetDetailsNotFound from './pages/petDetailsNotFound';
import Navigation from './components/navigation';
import {
  BrowserRouter,
  Route,
  Routes,
  Router,
  Link,
  Switch,
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Navigation />

      <Switch>
        <Route path="/:type/:id">
          <PetDetailsPage />
        </Route>
        <Route path="/pet-details-not-found">
          <PetDetailsNotFound />
        </Route>
        <Route path="/search">
          <SearchPage />
        </Route>
        <Route path="/:type?">
          <HomePage />
        </Route>
      </Switch>
    </Router>
